import React from "react";

import { ReactComponent as Facebook } from "../../assets/facebook.svg";
import { ReactComponent as Instagram } from "../../assets/facebook.svg";
import { ReactComponent as Twitter } from "../../assets/facebook.svg";
import { ReactComponent as YouTube } from "../../assets/facebook.svg";
import {
  FooterContainer,
  CopyrightSection,
  SocialmediaSection,
  SocialmediaIcons,
} from "./footer.styles";

const Footer = () => (
  <FooterContainer>
    <CopyrightSection>&copy; Crown Clothing Private Limited</CopyrightSection>
    <SocialmediaSection>
      <SocialmediaIcons>
        <Facebook />
      </SocialmediaIcons>
      <SocialmediaIcons>
        <Instagram />
      </SocialmediaIcons>
      <SocialmediaIcons>
        <Twitter />
      </SocialmediaIcons>
      <SocialmediaIcons>
        <YouTube />
      </SocialmediaIcons>
    </SocialmediaSection>
  </FooterContainer>
);

export default Footer;
